// AlbumTile.js
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

const AlbumTile = ({ onSongClick }) => {
  // ... (fetch albums logic)

  return (
    <div id="album-container">
      {albums.map(album => (
        <Link key={album._id} to={`/album/${album._id}`} className="album-tile">
          <img
            src={`images/${album.albumCoverArt}`}
            alt={`${album.albumTitle} Cover`}
            className="cover-art"
          />
          <h3>{album.albumTitle}</h3>
          <p>{album.artist}</p>
          {/* Pass the onSongClick handler to AlbumDetails */}
          <AlbumDetails album={album} onSongClick={onSongClick} />
        </Link>
      ))}
    </div>
  );
};

export default AlbumTile;
